package com.hx.entities;

import java.util.HashSet;
import java.util.Set;

public class User2 {

	
	private Integer id;
	private String name;
	private Integer age;
	
	private Set<Orders2> order2s = new HashSet<>();
	
	public Set<Orders2> getOrder2s() {
		return order2s;
	}
	public void setOrder2s(Set<Orders2> order2s) {
		this.order2s = order2s;
	}
	public User2() {
		super();
		// TODO Auto-generated constructor stub
	}
	public User2(Integer id, String name, Integer age) {
		super();
		this.id = id;
		this.name = name;
		this.age = age;
	}
	
	public Integer getId() {
		return id;
	}
	public void setId(Integer id) {
		this.id = id;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public Integer getAge() {
		return age;
	}
	public void setAge(Integer age) {
		this.age = age;
	}
	@Override
	public String toString() {
		return "User [id=" + id + ", name=" + name + ", age=" + age + "]";
	}
	
}
